(504404746349868146,504404746349868123,'2020-04-28 22:32:52','Add Log :<p>Minutes of Meeting dengan Pak Dewa ( Kadis DagPrintKopUKM Kab. Buleleng )</p>\r\n\r\n<ol>\r\n	<li>Konsentrasi penerapan eSemeton di minggu ini adalah untuk :&nbsp;\r\n	<ul>\r\n		<li>Membantu Pengurangan Penyebaran COVID-19</li>\r\n		<li>Ketahanan Pangan</li>\r\n		<li>Kesehatan : Alat dan Herbal</li>\r\n	</ul>\r\n	</li>\r\n	<li>Target Pertama : Implementasi Pasar Tradisional\r\n	<ul>\r\n		<li>tujuan : mengurangi kerumunan &amp; membuka lapangan usaha/kerja</li>\r\n		<li>2 pasar yang menjadi target&nbsp; : Pasar Banyuasri &amp; Pasar Anyar</li>\r\n		<li>Due Date tgl. 1 Mei 2020, siap data dan agen/kurir&nbsp;</li>\r\n		<li>Training di tgl. 4 Mei 2020</li>\r\n		<li>&nbsp;Partner usaha eSemeton : Agen dan Kurir akan disiapkan dari\r\n		<ul>\r\n			<li>Orang2 terdepat pasar</li>\r\n			<li>Tenaga2 kontrak yang sudah/hampir dirumahkan ( hanya 1 hari kerja per minggu)</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>Target Kedua&nbsp; : Implementasi untuk UMKM/IKM , parallel dengan pasar\r\n	<ul>\r\n		<li>tujuan : membantu pemasaran lokal dan provinsi</li>\r\n		<li>Target kategori :\r\n		<ul>\r\n			<li>Bahan pangan</li>\r\n			<li>Makanan jadi</li>\r\n			<li>Herbal</li>\r\n			<li>APD</li>\r\n			<li>Pertanian</li>\r\n		</ul>\r\n		</li>\r\n		<li>Training dilakukan per kategori / klasifikasi</li>\r\n	</ul>\r\n	</li>\r\n	<li>Membantu pemerintah dalam pendataan dan penanganan dampak COVID-19 terhadap usaha di Kab. Buleleng\r\n	<ul>\r\n		<li>DagPrinKopUkm akan men-share isian/form data input terdampak</li>\r\n		<li>Form eSemeton untuk Vendor bisa disesuaikan</li>\r\n	</ul>\r\n	</li>\r\n	<li>Branding dan Kolaborasi dgn Pemkab Buleleng\r\n	<ul>\r\n		<li>Stiker eSemeton di tambahkan Logo Pemkab Buleleng = Khusus untuk Buleleng, untuk keberadaan Pemerintah&nbsp;</li>\r\n	</ul>\r\n	</li>\r\n</ol>/Report by : Kartika Tanjana/PIC :Ayu Sukma',0),
