(504404746593802369,504404746593802365,'2020-05-01 18:18:26','Add follow up :In Progress / <p>Masukan untuk revolusi dokumentasi :<br />\r\nDokumentasi bugs, dokumentasi cara modul kemana saja relasinya itu yg penting seperti pembuatan skripsi, ada analisa, prototype, design, implementasi development jadi bisa diterapkan dengan tools yg ada saat ini.</p>\r\n\r\n<p>Meeting Management 01052020<br />\r\n1. Solusi untuk pemaparan ke programmer : dokumentasi detail, relasi, maksud dan tujuan modul yg detail.<br />\r\n2. Sistem Documentations &amp; Requirement<br />\r\n3. Create dokumentasi di google doc dll (berbasis database lebih bagus lagi)<br />\r\n4. Mahaputra dibuatkan arsitektur microservicesnya<br />\r\n5. Catatan oleh Customer, team, developer, tester, implementer dll<br />\r\n6. Ada yg tugas khusus nginput log nya.<br />\r\n7. Model data, alur, struktur informasi.<br />\r\n8. Di dokumen isi status permintaan (draft, permintaan, di FU, dikerjakan, penambahan)<br />\r\n9. Dokumen teknis di Sodevi<br />\r\n10. Dokumen administratif di Logboock<br />\r\n11. CRM + Survey system dimiliki Dimata dimulai lagi penggunaannya<br />\r\n12. Cari untuk stagging dan dokumen di bagian masing2 (dev, implement, tester, support, dan design)<br />\r\n13. Logbook : fitur collapse (2 baris) -expand, title<br />\r\n14. Jadwal mahaputra bisa di set paralel pengerjaannya. Untuk di bagian web &amp; apps dijelaskan yg mana (breakdown fitur)<br />\r\n15. Mahaputra : di vendor : Kategori, sub kategori, merk.<br />\r\n16. Mahaputra : Laporan di apps buat simple / download pdf saja.<br />\r\n17. Kirim UI Mahaputra ke Pak Tut yg ada.<br />\r\n&nbsp;<br />\r\n----LANGKAH PERTAMA REVOLUSI----<br />\r\nGunakan logbook, sodevi, crm</p>/ by : arysumber (Ary Sumberdana)',504404744486984502),
