(504404751945429240,504404751945429216,'2020-07-02 16:52:13','Add Log :<p><strong>Task Development Apps eSemeton</strong></p>\r\n\r\n<p>1.&nbsp;Kategori Lainnya dirubah menjadi eWisata, Di Pojok kanan bawah category tambahkan Menu More<br />\r\n2. Fitur Search --&gt;&nbsp;Update menjadi Search For Product &amp; Services<br />\r\n3. Tampilan Product --&gt;&nbsp;Tentukan Size Standar untuk Ukuran Foto, sehingga menampilkan Produk yang posisinya Rapi, tertata dan sejajar (Set Minimal Background)<br />\r\n4.&nbsp;Button Tambah Ke Keranjang Tambahkan Border yang sesuai atau boleh juga gunakan Warna<br />\r\n5.&nbsp;Produk -- Pada Icon Shipping Chart Tambahkan informasi <strong>Jumlah Current In Chart </strong>Sehingga memudahkan Customer untuk tidak membeli Double<br />\r\n6.&nbsp;Pada saat Loading (Icon Flutter) Ganti dengan Icon Loading<br />\r\n7.&nbsp;Main Categori Link ke Sub Categori Terkait <strong>Contoh : ePasar --&gt; Sayur, Buah, Daging<br />\r\n8.&nbsp;</strong>Filter Store By Category &amp; Filter Store By Distace / Jarak<br />\r\n9.&nbsp;Filter Produk By Vendor, Filter Produk By Distance, Select Multiple Category<br />\r\n10. Halaman Vendor -- &gt;&nbsp;Search Product Sorting per Category<br />\r\n11. Checkout arahkan ke WebView<br />\r\n12. Tambahkan Button Edit di My Product ( vendor)<br />\r\n13. Di Menu Account Vendor, Tambahkan Store Manager yang link ke Webview<br />\r\n14. Urutan Homepage --&gt;&nbsp;1. Search Produk 2. Ads (Iklan) 3. Promo 4. Produk 5. New Vendor/Store<br />\r\n&nbsp;</p>/Report by : Ayu Sukma/PIC :Made Hariyogi',0),
