(504404746221293406,1515,'<p>Dear Team Support,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>mengingat task2 yang perlu dikoordinasikan, dan selama ini kita tidak mendapatkan tools yg tepat untuk koordinasi localy&nbsp;&amp; remotely, maka kita akan aktivasi&nbsp; Dimata Logbook , sbb. :<br />\r\n<br />\r\n1) Logbook diaktifkan sbg media center task manajemen<br />\r\n2) Hosting di check , jika di dimatasystem masih ok, bisa lanjut<br />\r\n&nbsp; &nbsp; jika tidak bisa di host di VPS Alibaba Sampai 30 Agustus 2020,<br />\r\n3)&nbsp; Database, yg sekarang di backup save, kasih ID tgl.<br />\r\n&nbsp; &nbsp; &nbsp;Create dari clean lognya, dng master dibiarkan, kecuali<br />\r\n4) Data Struktur organisasi dan karyawan di refresh, di restore dari data karyawan dan Hairisma Dimata<br />\r\n5. Target life&nbsp; <strong>latest </strong>on 25 April 2020, 10:00 AM</p>','2020-04-24 00:00:00','2020-04-24 00:00:00',2,504404478559588815,504404546654547045,0,0,504404478563956511,0,504404530907759400,504404426562119802,NULL,'2020-04-29 00:00:00',504404442352458521,0,NULL),
