(504404746407878489,1521,'<p>eSemeton Toko Yashoda Klungkung<br />\r\nTarget :</p>\r\n\r\n<ol>\r\n	<li>Toko Yashoda klungkung menjadi pionir toko berjualan online</li>\r\n	<li>Menjual barang2 , yang ada di toko saat ini, makanan yang dijual di depan Toko, dan bahan pangan, dan kuliner di sekitar&nbsp; dan pasar yg dekat Toko&nbsp;</li>\r\n	<li>Target harga barang yg dijual di toko sama dengan harga jual online, harga makanan dari outlet di depan toko juga sama, harga bahan makanan di pasar diusahakan tetap menarik dan pantas</li>\r\n	<li>Membantu orang2 yang tidak PHK / dirumahkan untuk bisa menjadi kurir</li>\r\n	<li>Waktu sdh siap online Sabtu, tgl. 2 Mei 2020, pukul 8 :00</li>\r\n</ol>\r\n\r\n<p>Aksi :</p>\r\n\r\n<ol>\r\n	<li>Setup item esemeton Toko Yashoda : barang online sama dengan beli langsung di Toko Yashoda</li>\r\n	<li>Setup item pasar , harga akan di set sesuai harga nego dengan pedagang pasar</li>\r\n	<li>Setup item kuliner sekitar toko , disusahakan sama dengan dijual&nbsp; langsung</li>\r\n	<li>Setup onkir : Kode pos:&nbsp; 80176 = Rp. 8000 , Kode pos lain di kota klunkging 11500, diluar itu diambil atau kurir lainnya&nbsp;</li>\r\n	<li>Training :\r\n	<ul>\r\n		<li>eSemeton Admin Toko : Kasir dan Kepala Toko (Jero )&nbsp;</li>\r\n		<li>eSemeton&nbsp;Staff Toko : Kepala Toko , Kasir, Pramuniaga&nbsp;</li>\r\n		<li>eSemeton&nbsp;Kurir Toko : Kepala Toko , Admin, Pramuniaga</li>\r\n	</ul>\r\n	</li>\r\n	<li>Promosi di toko, pasar, radio, Medsos</li>\r\n</ol>','2020-04-29 00:00:00','2020-04-29 00:00:00',0,504404478559588815,504404540593468601,0,0,504404478563956511,0,504404744489523101,504404541278423720,'2020-05-02 00:00:00',NULL,504404531515493174,0,NULL),
