(504404746592085378,1529,'<p>REVOLUSI MANAGEMENT KERJA DIMATA</p>\r\n\r\n<ol>\r\n	<li>DOKUMENTASI PROJECT, SYSTEM, TASK, JOB</li>\r\n	<li>ALAT / TOOLS / SOFTWARE PENDUKUNG MANAGEMENT&nbsp;</li>\r\n	<li>TRAINING ONLINE E.G&nbsp; VIA https://udemy.com</li>\r\n	<li>System yang akan intact\r\n	<ul>\r\n		<li>Crisnam ( CRM + Survey )</li>\r\n		<li>LogBook</li>\r\n		<li>DRS</li>\r\n		<li>Sodevi</li>\r\n		<li>Doc Engine</li>\r\n	</ul>\r\n	</li>\r\n	<li>Start dari menggunakan yang ada , kmd ditambahkan fitur</li>\r\n	<li>Customer pakai fitur loogbook untuk komunikasi request dll ( user limited )</li>\r\n	<li>Semua itu masuk ke system, misal Work360, link dgn HRD untuk&nbsp; &nbsp;KPI</li>\r\n	<li>Java doc di Dev. dinilai per minggu</li>\r\n	<li>Logbook\r\n	<ol>\r\n		<li>+Title</li>\r\n		<li>Colaps,Expand</li>\r\n		<li>Smart Filter ; Assign for me , CC for Me, Status</li>\r\n		<li>Tambah : Project &amp; Product &gt; Module &gt; Related : dari CRM &amp; Sodevi&nbsp; ( Many to many ) &gt; bisa cepat nulis specification atu requrements</li>\r\n	</ol>\r\n	</li>\r\n</ol>','2020-05-01 00:00:00','2020-05-01 00:00:00',1,504404470186677361,504404524079843214,0,0,504404478563956511,0,504404625263196356,504404426562119802,'2020-05-02 00:00:00',NULL,504404442352458521,0,NULL),
