(504404746667411223,1531,'<p>Mahaputra GUI Design , comments</p>\r\n\r\n<ol>\r\n	<li>&nbsp;Order List : FILTER, diurutkan dean di buat placement grid yg rapi, bila perlu isi icon&nbsp; :&nbsp;<br />\r\n	[&nbsp; &nbsp;icon1 ] status 1&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;[&nbsp; &nbsp;icon2 ] status 2&nbsp;<br />\r\n	[&nbsp; &nbsp;icon1 ] status 3&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [&nbsp; &nbsp;icon2 ] status 4</li>\r\n	<li>Daftar customer kurang no. HP</li>\r\n	<li>Kategori barang&nbsp; perlu bertingkat , parent child,\r\n	<ul>\r\n		<li>Category Induk : Alat Listrik&nbsp; | Elektronik | Tools&nbsp;</li>\r\n		<li>Contoh Category&nbsp; :\r\n		<ul>\r\n			<li>Alat Listrik\r\n			<ul>\r\n				<li>Kabel,</li>\r\n				<li>Lampu,</li>\r\n				<li>Meteran Listrik</li>\r\n			</ul>\r\n			</li>\r\n			<li>Elektronik\r\n			<ul>\r\n				<li>Pendingin Ruangan (AC)\r\n				<ul>\r\n					<li>&nbsp;AC Split</li>\r\n					<li>AC Central</li>\r\n				</ul>\r\n				</li>\r\n			</ul>\r\n			</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>Perhatiakan jenis barang yg akan dijual adalah alat listrik juga, sehingga&nbsp; nanti mesti diperhatikan design UI input , misal&nbsp; kabel ada tipe, diameter kabel, diameter tembaga, jumlah kabel<br />\r\n	MInta detail dari item2 yang akan dijual sesuai dengan spek</li>\r\n	<li>Unit bisa bervariasi,&nbsp; spt kabel dalam meter , orang bisa beli kabel 1.5 meter, tapi tv belinya 1 unit</li>\r\n	<li>Fungsi2 yang ditampilkan di GUI mesti conform to spesifikasi dan scope project./kontrak, spy tidak menimbulkan salah paham</li>\r\n</ol>\r\n\r\n<p>* Bisa di check dahulu terutama&nbsp; point 6, senin spy di posting ke Mahaputra, sekalian kita akan buat Invoice</p>','2020-05-02 00:00:00','2020-05-02 00:00:00',1,504404746666386090,504404746666442437,0,0,504404478563956511,0,504404744486984502,504404746666999714,'2020-05-04 00:00:00',NULL,504404746656907308,0,NULL),
