(504404747772502816,1541,'<p>Commentar Design GUI eSemeton</p>\r\n\r\n<ol>\r\n	<li>Selamat Datang\r\n	<ul>\r\n		<li>D huruf besar</li>\r\n		<li>tidak usah isi tulisan di eSemeton di bawah Selamat Datang</li>\r\n		<li>di Center : Logo dgn Tulisan eSemeton dibawahnya</li>\r\n	</ul>\r\n	</li>\r\n	<li>Dashboard&nbsp;\r\n	<ul>\r\n		<li>menu bar nomor 1 paling atas\r\n		<ul>\r\n			<li>di Logo esemeton dan tulisan esemeton tidak usah isi Semua bersaudara semua sejahtera, dan&nbsp; ini bisa di click&nbsp; dan akan muncul drop down menu :&nbsp; News ,&nbsp;About&nbsp;</li>\r\n			<li>Icon Promo tidak usah isi tulisan Promo, cukup icon saja,sehingga tidak penuh</li>\r\n		</ul>\r\n		</li>\r\n		<li>menu bar nomor 2 dari atas&nbsp;\r\n		<ul>\r\n			<li>Cari Produk/Jasa/Vendor : bisa cari product /jasa atau vendor, list nya terpisah</li>\r\n		</ul>\r\n		</li>\r\n		<li>menu bar nomor 3&nbsp;\r\n		<ul>\r\n			<li>Warna bisa di cari&nbsp;yg lebih fresh</li>\r\n			<li>Icon Kebutuhan Ku , yg menonjol itu thema&nbsp;kalendar</li>\r\n			<li>Semua icon mesti dibuat dalam bobot yang sama itu ada besar kecil, bisa dibuat segiempat rounded atau longkaran&nbsp;yang sama</li>\r\n		</ul>\r\n		</li>\r\n		<li>&nbsp;Icons Kelompok Usaha\r\n		<ul>\r\n			<li>posisi eKurir dan eTani di tukar</li>\r\n			<li>Warna eKurir sebaiknya diganti&nbsp; spy tidak sama dengan eTani</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ol>','2020-05-15 00:00:00','2020-05-15 00:00:00',0,504404746666386090,504404746666442437,0,0,504404478563956511,0,504404744486984502,504404426562119802,'2020-05-16 00:00:00',NULL,504404442352458521,0,NULL),
