(504404748815758411,1543,'<p>follow up training&nbsp;eSemeton :<br />\r\n<br />\r\n* Peserta yang mendaftar mulai di initiate untuk pendampingan mendaftar dan masuk ke eSemeton ( Jadwal segera follow up )<br />\r\n* Dibuatkan sesi photo graphic 5 produk gratis bertempat di Workshop Dimata.<br />\r\n&nbsp;Disesuaikan dengan kesiapan data nya, nanti per sesi 2 UMKM, 30 menit.&nbsp; nanti kita tayangkan life di channel You tube dan Zoom meeting kita</p>\r\n\r\n<p>Target tgl. 7 Juni 2020 sudah online</p>','2020-05-27 00:00:00','2020-05-27 00:00:00',0,504404478635132965,504404478635256767,0,0,504404744489523101,0,504404744486984502,504404426562119802,NULL,NULL,504404442352458521,0,NULL),
(504404751141773283,1544,'<p><strong>Task List Development eSemeton Apps</strong></p>\r\n\r\n<ol>\r\n	<li>Login Page : Tidak berhasil Login --&gt; Buffering Sangat lama Harus Isikan Kolom, Klik Login Facebook, Baru Back / Cancel dia berhasil login</li>\r\n	<li>Searching Address : Memilih alamat di Google Maps, Klik <strong>Tap To Select This Location</strong> Tapi lokasinya belum bisa terpilih</li>\r\n	<li>Checkout Shipping di Apps 0 padahal Sudah memilih kodepos yang sudah di setup nilai ongkirnya--&gt; Berubah setelah redirect ke Web View</li>\r\n	<li>Rate The App : Masih terhubung ke Playstore &agrave; Fluxstore ( Next dihubungkan ke eSemeton)</li>\r\n	<li>Tambahkan Filter Berdasarkan Usaha</li>\r\n	<li>Order History<br />\r\n	<em>Tambahkan Informasi Pembayaran sesuai dengan type pembayaran yang dipilih oleh Customer : </em><br />\r\n	1. QRIS BPD BALI : Tampilkan QR Code eSemeton QRIS<br />\r\n	2. Link Aja! : Tampilkan QR Code LinkAja!<br />\r\n	3. Bank Transfer : Tampilkan Informasi Bank Account eSemeton/Dimata<br />\r\n	<em>No Rekening eSemeton PT. Dimata Sora Jayate -<br />\r\n	Bank BPD Cab Teuku Umar : 0290111000325 -<br />\r\n	Bank Permata Cab Melati : 702162505 </em><br />\r\n	<strong>Kirim Bukti Transfer ke </strong><em>- Whatsapp eSemeton --&gt; Link WA - Email eSemeton --&gt; Link email</em></li>\r\n</ol>','2020-06-20 00:00:00','2020-06-23 00:00:00',1,504404426561916489,504404746385836459,0,0,504404744489523101,0,504404746333847388,504404426562119802,NULL,NULL,504404442352458521,0,NULL),
