(504404751945429216,1547,'<p><strong>Task Development Apps eSemeton</strong></p>\r\n\r\n<p>1.&nbsp;Kategori Lainnya dirubah menjadi eWisata, Di Pojok kanan bawah category tambahkan Menu More<br />\r\n2. Fitur Search --&gt;&nbsp;Update menjadi Search For Product &amp; Services<br />\r\n3. Tampilan Product --&gt;&nbsp;Tentukan Size Standar untuk Ukuran Foto, sehingga menampilkan Produk yang posisinya Rapi, tertata dan sejajar (Set Minimal Background)<br />\r\n4.&nbsp;Button Tambah Ke Keranjang Tambahkan Border yang sesuai atau boleh juga gunakan Warna<br />\r\n5.&nbsp;Produk -- Pada Icon Shipping Chart Tambahkan informasi <strong>Jumlah Current In Chart </strong>Sehingga memudahkan Customer untuk tidak membeli Double<br />\r\n6.&nbsp;Pada saat Loading (Icon Flutter) Ganti dengan Icon Loading<br />\r\n7.&nbsp;Main Categori Link ke Sub Categori Terkait <strong>Contoh : ePasar --&gt; Sayur, Buah, Daging<br />\r\n8.&nbsp;</strong>Filter Store By Category &amp; Filter Store By Distace / Jarak<br />\r\n9.&nbsp;Filter Produk By Vendor, Filter Produk By Distance, Select Multiple Category<br />\r\n10. Halaman Vendor -- &gt;&nbsp;Search Product Sorting per Category<br />\r\n11. Checkout arahkan ke WebView<br />\r\n12. Tambahkan Button Edit di My Product ( vendor)<br />\r\n13. Di Menu Account Vendor, Tambahkan Store Manager yang link ke Webview<br />\r\n14. Urutan Homepage --&gt;&nbsp;1. Search Produk 2. Ads (Iklan) 3. Promo 4. Produk 5. New Vendor/Store<br />\r\n&nbsp;</p>','2020-06-29 00:00:00','2020-07-02 00:00:00',1,504404426561916489,504404746385836459,0,0,504404744489523101,0,504404746333847388,504404426562119802,NULL,NULL,504404442352458521,0,NULL),
(504404752269815883,1548,'<p>Meeting 3 Juli 2020</p>\r\n\r\n<p>=============Development==============<br />\r\n1. Loading Sebelum menuju ke Home Page, manfaatkan sebagai Media edukasi tentang Covid 19 / eSemeton ( diambil dri Konsep&quot; eSemeton yang sebelumnya sudah dipresentasikan)<br />\r\n2. fitur Lokasi terdekat (Maps)<br />\r\n3. Di Bagian Header ada : Logo, Maps ( Untuk Jarak terdekat), Promo, eDonasi, dan Wishlist<br />\r\n4. di Menu Home, Judul dari masing-masing Adds, Promo disamakan dengan WebView Jaraknya agak dirapatkan<br />\r\n5. Setting urutan di Home Page :<br />\r\n&nbsp; &nbsp;a. Header<br />\r\n&nbsp; &nbsp;b. Search Produk<br />\r\n&nbsp; &nbsp;c. Iklan<br />\r\n&nbsp; &nbsp;d. Kategori<br />\r\n5. Pastikan Untuk Produk Terbaru itu Link nya dari mana<br />\r\n6. Fitur Kebutuhanku : Notifikasi ke Customer ttg Prediksi Kebutuhan Harian (&nbsp; Masih cari Plg in)<br />\r\n7. Fitur eDompet akan direview lebih lanjut</p>\r\n\r\n<p><br />\r\n=============Review Google Form===========<br />\r\n1. Siapkan Workshop untuk Training Photo &amp; Narasi Produk<br />\r\n2. Aktifkan Vendor yang sudah Respon Google Form, BDP &amp; Yang sudah aktif sebelumnya<br />\r\n3. Vendor Menyiapkan Foto Produk per Variasi disertai dnegan Promo&quot; Menarik yang akan diPos di eSemeton<br />\r\n4. FU Vendor yang sudah Aktif untuk Update harga terbaru<br />\r\n5. Komunikasi dq Pak Satwika terkait Vendor yang masih kurang dalam pengambilan Photo Produk<br />\r\n6. Update Apps Terbaru sehingga bisa Online.<br />\r\n7. Aktifkan Fitur Kirim via Ekspedisi (JNT, TIKI, POS, dsb) dan Shipping By Distance</p>\r\n\r\n<p>==========Meeting 09 Juli 2020 ==========<br />\r\n1. eDonasi :<br />\r\n&nbsp; &nbsp;Membeli Produk Donasi dari eSemeton Langsung. Terdiri dalam bentuk Paket Spt : Sembako, dll dengan harga tetap<br />\r\n&nbsp; &nbsp;Kategori donasi hanya dapat dipilih oleh eSemeton, Setup Merchant eSemeton atau Buatkan Vendor Khusus eSemeton Donation<br />\r\n2. Mempererat Kerjasama dengan BPD melalui Branding<br />\r\n&nbsp; &nbsp;Support By BPD Bali &amp; Powered By Dimata IT Solutions&nbsp;&nbsp;<br />\r\n&nbsp; &nbsp;Breakdown Partnership Advertisement Packet&nbsp;<br />\r\n&nbsp; &nbsp;a. Splash Screen<br />\r\n&nbsp; &nbsp;b. Registration<br />\r\n&nbsp; &nbsp;c. Home Page<br />\r\n&nbsp; &nbsp;d. As a Footer Banner<br />\r\n&nbsp; &nbsp;e. Running Text di home<br />\r\n3. Setup Category Icon<br />\r\n4. Fitur Searching Vendor<br />\r\n5. Promo Link ke Toko dulu setelahnya ke Produk</p>','2020-07-03 00:00:00','2020-07-06 00:00:00',0,504404506284253923,504404518638498373,0,0,504404744489523101,0,504404746221036146,504404426562119802,NULL,NULL,504404442352458521,0,NULL),
