(504404752809229390,1550,'<p>[4:46 PM, 7/12/2020] Ketut Kartika T.: Kita buat siklus buat flyer percepat dgn buatkan google form pembuatan flyer di eSemeton google, nanti ada rekanan bisnis dan internal Dimata juga, yg minta buat flyer kita minta isi form dulu. spt :<br />\r\n1) Nama Organisasi<br />\r\n+ Tag line organisasi , website<br />\r\n2) Divisi / Department<br />\r\n3) Kontak HP / WA / email<br />\r\n4) Jabatan<br />\r\n5) Jenis Acara : Webminar , Workshop Online, Seminar, Workshop, dll<br />\r\n6) Judul Acara , Tanggal : Jam , batasan jumlah peserta<br />\r\n7) Sub Judul<br />\r\n8) Narasumber 1- 8 : Nama, Organisasi, Jabaran , Judul Materi , Foto Narasumber, Foto Organisasi, 3 foto Pendukung<br />\r\n9) Link Zoom / Online Webminar Tools ( dikosongkan bila kita yg membuatkan )<br />\r\n10) Link You Tube Live Broadcast ( dikosongkan bila kita yg membuatkan )<br />\r\n11) Contact Person : HP dan WA acara<br />\r\n12) Template yang dipilih<br />\r\nLink Formpendaftaran : kita yg buatkan nanti data peserta ini benefit buat kita , jadi kita buatkan syarat dan ketentuannya. Baik untuk yg minta dibuatkan Flyer maupun yg mendaftar sebagai pesertanya.<br />\r\nJadi di eSemeton , ini bisa jadi spt pembuatan Logo di WIX</p>','2020-07-12 00:00:00','2020-07-12 00:00:00',1,504404470186677361,504404524079843214,0,0,504404478563956511,0,504404744486984502,504404426562119802,'2020-07-15 00:00:00',NULL,504404442352458521,0,NULL),
(504404753040924969,1551,'<p>1. Approval Vendor Store Setelah daftar Melalui Apps<br />\r\n2. Fitur Search Produk di Store<br />\r\n3. Button Fitur Chat di Awal<br />\r\n4. Main Categori --&gt; Sub Categori di Navigasi Kategori</p>','2020-07-15 00:00:00','2020-07-15 00:00:00',0,504404426561916489,504404426561998223,0,0,504404744489523101,0,504404746333847388,504404426562119802,NULL,NULL,504404442352458521,0,NULL),
(504404753473028007,1552,'<p>==========Note Of Meeting (18 Juli 2020)==========<br />\r\nMeeting Note : https://drive.google.com/drive/folders/1qouxNcZ9q_Z75EzoxXBdUJZOIHyBz_bZ?usp=sharing<br />\r\n============================================<br />\r\n1. Perbedaan Hardselling &amp; SoftSelling<br />\r\n&nbsp; &nbsp; * Hardselling : Direct Selling atau penjualan secara langsung, Ditandai dengan adanya Angka / Nilai&nbsp;<br />\r\n&nbsp; &nbsp; * Softselling : Disertai dengan Perkenalan/ Introducing yang menimbulkan ketertarikan dari Konsumen, Ada step sebelum mengarahkan Customer ke Product<br />\r\n2. Menu Home<br />\r\n&nbsp; &nbsp; * Banner Ads ( Diatas Kategori Utama) disajikan Soft Seling / Informasi Covid-19, Caring &amp; Sharing, Promo<br />\r\n&nbsp; &nbsp; * Set Timing untuk menampilkan Produk yang Promo ( ex : hanya 2 Hari)<br />\r\n&nbsp; &nbsp; * Layout Menu Home :<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;- Banner Soft Selling<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;Kategori<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;Promo(Hardselling) Timing View By Request<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;Produk dengan Thumbnail yang lebih kecil<br />\r\n&nbsp; &nbsp; * Penampilan Promo berdasarkan Harga, Terlaris dan Angka yang Besar ( Refrensi Check : Tokopedia &amp; Other Marketplace)<br />\r\n3.&nbsp;Layout Kategori<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;- Ads<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;- Lokasi ( Menampilkan Terdekat, Terlaris, Terbaru)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;- Kategori<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;- Produk<br />\r\n4. Merchant Categori<br />\r\n&nbsp; &nbsp; Klasifikasi Kategori usaha yang lebih mendetail [Eks ePasar --&gt; Pasar Tradisional, Rakyat eToko --&gt; Elektronik, Sembako, ATK]<br />\r\n&nbsp; ==============URGENT TASK ==============<br />\r\n1. Store Manager langsung redirect ke Web Browser<br />\r\n&nbsp; &nbsp; Note : &quot;Manajemen Usaha akan dilakukan di Web Browser. Untuk keamanan data dan Informasi silahkan Login Ulang&quot;<br />\r\n&nbsp; &nbsp; - Pada saat vendor memiliki order yang baru masuk atau belum di proses<br />\r\n&nbsp; &nbsp; &nbsp; Note : Anda memiliki Order Sejumlah =....... / Order yang belum di proses=............<br />\r\n2. Hide menu Produk Saya di Akun<br />\r\n3. Notifikasi Order di Store Manager ( Bulat kecil di menu&nbsp; Akun/Red Kedip&quot;) di Store Manager isi Jumlah Notifikasi<br />\r\n4. Daftarkan Merchant eSemeton ke Mitra Link Aja<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','2020-07-18 00:00:00','2020-07-20 00:00:00',1,504404506284253923,504404517976559326,0,0,504404744489523101,0,504404746221036146,504404426562119802,NULL,NULL,504404442352458521,0,NULL),
